import React, { Component } from "react";
import me from "../../img/profilePic.jpg";

class Form extends Component {
  render() {
    return (
      <div className="container">
        <div className="col-md-6">
          <img id="profilePic" src={me} alt="Profile pic"></img>
        </div>
        <div className="col-md-6">
          <h1>Travis Lloyd</h1>
          <h2>Travislloyd@lloyddm.com</h2>
          <h2>661-414-4027</h2>
        </div>
      </div>
    );
  }
}

export default Form;
